import React from "react";
import Header from "../Common/Header/Header";
import NavHeader from "../Common/Header/NavHeader/NavHeader";
import Banner from "../components/Banner";
import styled from "styled-components";
import { productlist } from "../ProductDummy";
import Suggest from "../components/Suggest";

export default function Main() {
  return (
    <>
      <Header />
      <NavHeader />
      <Banner />
      <MainWrap>
        <MainTitle>
          <span>이 상품 어때요?</span>
        </MainTitle>

        <MainProduct>
          <MainImgCotainer>
            <Container>
              {productlist.map((item) => {
                return (
                  <Suggest text={item.text} url={item.url} price={item.price} />
                );
              })}
            </Container>
          </MainImgCotainer>
          <MainSwiper></MainSwiper>
        </MainProduct>
      </MainWrap>
    </>
  );
}

export const MainWrap = styled.div`
  width: 1050px;
  margin: 0px auto;
  padding: 40px 0px;
`;

export const MainTitle = styled.div`
  margin-bottom: 27px;
  display: flex;
  flex-direction: column;
  -webkit-box-pack: center;
  justify-content: center;
  -webkit-box-align: center;
  align-items: center;
  & span {
    color: rgb(51, 51, 51);
    font-size: 28px;
    line-height: 1.15;
    letter-spacing: -0.26px;
    font-weight: 500;
  }
`;

export const MainProduct = styled.div`
  position: relative;
  width: 1050px;
  margin: 0px auto;
`;

export const MainSwiper = styled.div``;

export const Container = styled.div``;

export const ProductItem = styled.div``;

export const MainImgCotainer = styled.div`
  overflow: hidden;
  width: 1050px;
  touch-action: pan-y;
  margin-left: auto;
  margin-right: auto;
  position: relative;
  overflow: hidden;
  list-style: none;
  padding: 0;
  z-index: 1;
  font-size: 14px;
  color: #333;
`;
